import './CodeBlock.css';

import { CopyBlock, dracula } from "react-code-blocks";

function CodeBlock({ text }) {
  return (
    <div className="CodeBlock">
        <CopyBlock
          language="python"
          text={`print(3.14`}
          codeBlock
          theme={dracula}
          showLineNumbers={false}
        />
    </div>
  );
}

export default CodeBlock;
